import React from 'react';
import Parallax from 'react-parallax';

function Weather() {

    return (
        <div>
            <Parallax
                bgImage={require('./imgs/rowan-heuvel.jpg')}
                bgImageAlt="Jumbotron"
                strength={200}
            >
                <div className="weather-section">

                </div>
            </Parallax>
        </div>
    );
}

export default Weather;
